import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const API_URL = 'http://localhost:5000';

function App() {
  const [users, setUsers] = useState([]);
  const [formData, setFormData] = useState({ name: '', email: '', age: '' });
  const [updateData, setUpdateData] = useState({ id: '', name: '', email: '', age: '' });
  const [deleteId, setDeleteId] = useState('');
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await axios.get(`${API_URL}/users`);
      setUsers(response.data);
    } catch (error) {
      setMessage('Error fetching users');
    }
  };

  const createUser = async () => {
    try {
      await axios.post(`${API_URL}/users`, formData);
      setMessage('User created successfully!');
      setFormData({ name: '', email: '', age: '' });
      fetchUsers();
    } catch (error) {
      setMessage('Error creating user');
    }
  };

  const updateUser = async () => {
    try {
      await axios.put(`${API_URL}/users/${updateData.id}`, {
        name: updateData.name,
        email: updateData.email,
        age: updateData.age
      });
      setMessage('User updated successfully!');
      setUpdateData({ id: '', name: '', email: '', age: '' });
      fetchUsers();
    } catch (error) {
      setMessage('Error updating user');
    }
  };

  const deleteUser = async () => {
    try {
      await axios.delete(`${API_URL}/users/${deleteId}`);
      setMessage('User deleted successfully!');
      setDeleteId('');
      fetchUsers();
    } catch (error) {
      setMessage('Error deleting user');
    }
  };

  return (
    <div className="App">
      <h1>User Management System</h1>

      {message && <div className="message">{message}</div>}

      <div className="section">
        <h2>Create User</h2>
        <input
          type="text"
          placeholder="Name"
          value={formData.name}
          onChange={(e) => setFormData({...formData, name: e.target.value})}
        />
        <input
          type="email"
          placeholder="Email"
          value={formData.email}
          onChange={(e) => setFormData({...formData, email: e.target.value})}
        />
        <input
          type="number"
          placeholder="Age"
          value={formData.age}
          onChange={(e) => setFormData({...formData, age: e.target.value})}
        />
        <button onClick={createUser}>Create User</button>
      </div>

      <div className="section">
        <h2>Update User</h2>
        <input
          type="text"
          placeholder="User ID"
          value={updateData.id}
          onChange={(e) => setUpdateData({...updateData, id: e.target.value})}
        />
        <input
          type="text"
          placeholder="New Name"
          value={updateData.name}
          onChange={(e) => setUpdateData({...updateData, name: e.target.value})}
        />
        <input
          type="email"
          placeholder="New Email"
          value={updateData.email}
          onChange={(e) => setUpdateData({...updateData, email: e.target.value})}
        />
        <input
          type="number"
          placeholder="New Age"
          value={updateData.age}
          onChange={(e) => setUpdateData({...updateData, age: e.target.value})}
        />
        <button onClick={updateUser}>Update User</button>
      </div>

      <div className="section">
        <h2>Delete User</h2>
        <input
          type="text"
          placeholder="User ID to Delete"
          value={deleteId}
          onChange={(e) => setDeleteId(e.target.value)}
        />
        <button onClick={deleteUser} className="delete-btn">Delete User</button>
      </div>

      <div className="section">
        <h2>All Users</h2>
        <button onClick={fetchUsers}>Refresh Users</button>
        <div className="users-list">
          {users.map(user => (
            <div key={user._id} className="user-card">
              <p><strong>ID:</strong> {user._id}</p>
              <p><strong>Name:</strong> {user.name || user.username}</p>
              <p><strong>Email:</strong> {user.email}</p>
              <p><strong>Age:</strong> {user.age || 'N/A'}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default App;
